import React, { useState } from 'react';
import '../styles/ApplicationList.css';

function ApplicationList({ userType }) {
  // Mock data for applications with roles
  const [applications, setApplications] = useState([
    { id: 1, name: 'App1', url: 'https://app1.example.com', roles: ['Admin', 'User'] },
    { id: 2, name: 'App2', url: 'https://app2.example.com', roles: ['Viewer', 'Editor'] },
    { id: 3, name: 'App3', url: 'https://app3.example.com', roles: ['Basic', 'Premium'] },
  ]);

  const [newApp, setNewApp] = useState({ name: '', url: '', roles: '' });
  const [newRole, setNewRole] = useState({ appId: '', roleName: '' });

  const handleAddApplication = () => {
    if (newApp.name && newApp.url) {
      const roles = newApp.roles.split(',').map(role => role.trim());
      setApplications([...applications, {
        id: applications.length + 1,
        name: newApp.name,
        url: newApp.url,
        roles: roles
      }]);
      setNewApp({ name: '', url: '', roles: '' });
    }
  };

  const handleAddRole = () => {
    if (newRole.appId && newRole.roleName) {
      setApplications(applications.map(app => 
        app.id === parseInt(newRole.appId)
          ? { ...app, roles: [...app.roles, newRole.roleName] }
          : app
      ));
      setNewRole({ appId: '', roleName: '' });
    }
  };

  const handleRemoveRole = (appId, roleToRemove) => {
    setApplications(applications.map(app =>
      app.id === appId
        ? { ...app, roles: app.roles.filter(role => role !== roleToRemove) }
        : app
    ));
  };

  return (
    <div className="application-list-container">
      <h3>Applications</h3>

      {userType === 'admin' && (
        <div className="admin-controls">
          <div className="add-application-form">
            <h4>Add New Application</h4>
            <input
              type="text"
              value={newApp.name}
              onChange={(e) => setNewApp({ ...newApp, name: e.target.value })}
              placeholder="Application Name"
            />
            <input
              type="text"
              value={newApp.url}
              onChange={(e) => setNewApp({ ...newApp, url: e.target.value })}
              placeholder="Application URL"
            />
            <input
              type="text"
              value={newApp.roles}
              onChange={(e) => setNewApp({ ...newApp, roles: e.target.value })}
              placeholder="Roles (comma-separated)"
            />
            <button onClick={handleAddApplication}>Add Application</button>
          </div>

          <div className="add-role-form">
            <h4>Add New Role</h4>
            <select
              value={newRole.appId}
              onChange={(e) => setNewRole({ ...newRole, appId: e.target.value })}
            >
              <option value="">Select Application</option>
              {applications.map(app => (
                <option key={app.id} value={app.id}>{app.name}</option>
              ))}
            </select>
            <input
              type="text"
              value={newRole.roleName}
              onChange={(e) => setNewRole({ ...newRole, roleName: e.target.value })}
              placeholder="Role Name"
            />
            <button onClick={handleAddRole}>Add Role</button>
          </div>
        </div>
      )}

      <ul>
        {applications.map((app) => (
          <li key={app.id}>
            <div className="app-info">
              <span className="app-name">{app.name}</span>
              {userType === 'admin' && (
                <div className="app-roles">
                  <strong>Roles:</strong>
                  {app.roles.map((role, index) => (
                    <span key={index} className="role-tag">
                      {role}
                      <button 
                        className="remove-role"
                        onClick={() => handleRemoveRole(app.id, role)}
                      >
                        Ã—
                      </button>
                    </span>
                  ))}
                </div>
              )}
            </div>
            <div className="app-actions">
              <button onClick={() => window.open(app.url, '_blank')}>Access</button>
              {userType === 'admin' && (
                <button onClick={() => alert(`Manage ${app.name}`)}>Manage</button>
              )}
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ApplicationList;
